class Solution {
    public int minimumBeautifulSubstrings(String s) {
        if (s.charAt(0) == '0') return -1;
        int n = s.length();
        int[] dp = new int[n + 1];
        for (int i = 0; i <= n; i++) dp[i] = Integer.MAX_VALUE / 2;
        dp[0] = 0;

        for (int i = 1; i <= n; i++) {
            long num = 0;
            for (int j = i; j >= 1; j--) {
                num = num >> 1 | (s.charAt(j - 1) - '0') << (i - j);
                if (s.charAt(j - 1) == '0') continue;
                if ((num & (num - 1)) == 0 && (num % 5 == 0)) {
                    dp[i] = Math.min(dp[i], dp[j - 1] + 1);
                }
            }
        }
        return dp[n] >= Integer.MAX_VALUE / 2 ? -1 : dp[n];
    }
}
